        [Fact]
        public void ExportData_ReturnsCorrectStringArray()
        {
            //Arrange
            Mock<IDataset> mockDataset = new Mock<IDataset>();
            mockDataset.Setup(x => x.DatasetID).Returns(It.IsAny<int>);
            mockDataset.Setup(x => x.DatasetToDataTable()).Returns(GetTestDataTable());

            RepeatedMeasuresParametricAnalysisModel sut = GetModel(mockDataset.Object);
            sut.Treatments = new List<string> { "Treat 1" };
            sut.OtherDesignFactors = null;
            sut.Covariates = null;

            //Act
            string[] result = sut.ExportData();

            //Assert
            Assert.Equal("Resp2,Treativs_sp_ivs1,Animal1,Dayivs_sp_ivs1,between,betweenwithin,mainEffect", result[0]);
            Assert.Equal(288, result.Count()); //as blank reponses are removed
            Assert.StartsWith("0.366480348974443,B", result[32]);

            //between check
            Assert.Contains(",C,", result[24]);

            //betweenwithin check
            Assert.Contains(",C D1,", result[24]);

            //mainEffect check
            Assert.EndsWith(",_.._C_.._D1", result[24]);
        }

        [Fact]
        public void ExportData_MultipleTreatments_ReturnsCorrectStringArray()
        {
            //Arrange
            Mock<IDataset> mockDataset = new Mock<IDataset>();
            mockDataset.Setup(x => x.DatasetID).Returns(1);
            mockDataset.Setup(x => x.DatasetToDataTable()).Returns(GetTestDataTable());

            RepeatedMeasuresParametricAnalysisModel sut = GetModel(mockDataset.Object);

            //Act
            string[] result = sut.ExportData();

            //Assert
            Assert.Equal("Resp2,Treativs_sp_ivs1,Treativs_sp_ivs2,Block1,Block2,Animal1,Dayivs_sp_ivs1,Cov1,between,betweenwithin,mainEffect", result[0]);

            //between check
            Assert.Contains(",C y,", result[24]);

            //betweenwithin check
            Assert.Contains(",C y D1,", result[24]);

            //mainEffect check
            Assert.EndsWith(",_.._C_.._D1", result[24]);
        }

        [Fact]
        public void GetArguments_ReturnsCorrectArguments()
        {
            //Arrange
            RepeatedMeasuresParametricAnalysisModel sut = GetModel(GetDataset());

            //Act
            List<Argument> result = sut.GetArguments().ToList();

            //Assert
            var response = result.Single(x => x.Name == "Response");
            Assert.Equal("Resp2", response.Value);

            var treatments = result.Single(x => x.Name == "Treatments");
            Assert.Equal("Treat 1,Treat 2", treatments.Value);

            var repeatedFactor = result.Single(x => x.Name == "RepeatedFactor");
            Assert.Equal("Day 1", repeatedFactor.Value);

            var subject = result.Single(x => x.Name == "Subject");
            Assert.Equal("Animal1", subject.Value);

            var otherDesignFactors = result.Single(x => x.Name == "OtherDesignFactors");
            Assert.Equal("Block1,Block2", otherDesignFactors.Value);

            var covariates = result.Single(x => x.Name == "Covariates");
            Assert.Equal("Cov1", covariates.Value);

            var responseTransformation = result.Single(x => x.Name == "ResponseTransformation");
            Assert.Equal("None", responseTransformation.Value);

            var covariateTransformation = result.Single(x => x.Name == "CovariateTransformation");
            Assert.Equal("None", covariateTransformation.Value);

            var primaryFactor = result.Single(x => x.Name == "PrimaryFactor");
            Assert.Equal("Treat 1", primaryFactor.Value);

            var selectedEffect = result.Single(x => x.Name == "SelectedEffect");
            Assert.Equal("Treat 1 * Day 1", selectedEffect.Value);

            var anovaSelected = result.Single(x => x.Name == "ANOVASelected");
            Assert.Equal("True", anovaSelected.Value);

            var prPlotSelected = result.Single(x => x.Name == "PRPlotSelected");
            Assert.Equal("True", prPlotSelected.Value);

            var covariance = result.Single(x => x.Name == "Covariance");
            Assert.Equal("Compound Symmetric", covariance.Value);

            var comparisonType = result.Single(x => x.Name == "ComparisonType");
            Assert.Equal("AllComparisonsWithinSelected", comparisonType.Value);

            var lsMeansSelected = result.Single(x => x.Name == "LSMeansSelected");
            Assert.Equal("False", lsMeansSelected.Value);

            var normalPlotSelected = result.Single(x => x.Name == "NormalPlotSelected");
            Assert.Equal("False", normalPlotSelected.Value);

            var significance = result.Single(x => x.Name == "Significance");
            Assert.Equal("0.05", significance.Value);
        }

        [Fact]
        public void LoadArguments_ReturnsCorrectArguments()
        {
            //Arrange
            RepeatedMeasuresParametricAnalysisModel sut = new RepeatedMeasuresParametricAnalysisModel(GetDataset());

            List<Argument> arguments = new List<Argument>();
            arguments.Add(new Argument { Name = "Response", Value = "Resp1" });
            arguments.Add(new Argument { Name = "Treatments", Value = "Treat1,Treat2" });
            arguments.Add(new Argument { Name = "Subject", Value = "Animal1" });
            arguments.Add(new Argument { Name = "RepeatedFactor", Value = "Day1" });
            arguments.Add(new Argument { Name = "OtherDesignFactors", Value = "Block1,Block2" });
            arguments.Add(new Argument { Name = "ResponseTransformation", Value = "Log10" });
            arguments.Add(new Argument { Name = "Covariates", Value = "Cov1" });
            arguments.Add(new Argument { Name = "PrimaryFactor", Value = "Treat1" });
            arguments.Add(new Argument { Name = "CovariateTransformation", Value = "ArcSine" });
            arguments.Add(new Argument { Name = "ANOVASelected", Value = "False" });
            arguments.Add(new Argument { Name = "PRPlotSelected", Value = "True" });
            arguments.Add(new Argument { Name = "NormalPlotSelected", Value = "False" });
            arguments.Add(new Argument { Name = "Significance", Value = "0.9" });
            arguments.Add(new Argument { Name = "SelectedEffect", Value = "Treat 1 * Day 1" });
            arguments.Add(new Argument { Name = "LSMeansSelected", Value = "True" });
            arguments.Add(new Argument { Name = "Covariance", Value = "Compound Symmetric" });
            arguments.Add(new Argument { Name = "ComparisonType", Value = "AllComparisonsWithinSelected" });

            Assert.Equal(17, arguments.Count);

            //Act
            sut.LoadArguments(arguments);

            //Assert
            Assert.Equal("Resp1", sut.Response);
            Assert.Equal(new List<string> { "Treat1", "Treat2" }, sut.Treatments);
            Assert.Equal("Animal1", sut.Subject);
            Assert.Equal("Day1", sut.RepeatedFactor);
            Assert.Equal(new List<string> { "Block1", "Block2" }, sut.OtherDesignFactors);
            Assert.Equal("Log10", sut.ResponseTransformation);
            Assert.Equal(new List<string> { "Cov1" }, sut.Covariates);
            Assert.Equal("Treat1", sut.PrimaryFactor);
            Assert.Equal("ArcSine", sut.CovariateTransformation);
            Assert.False(sut.ANOVASelected);
            Assert.True(sut.PRPlotSelected);
            Assert.False(sut.NormalPlotSelected);
            Assert.Equal("0.9", sut.Significance);
            Assert.Equal("Treat 1 * Day 1", sut.SelectedEffect);
            Assert.True(sut.LSMeansSelected);
            Assert.Equal("Compound Symmetric", sut.Covariance);
            Assert.Equal("AllComparisonsWithinSelected", sut.ComparisonType.ToString());
        }


        [Fact]
        public void GetCommandLineArguments_ReturnsCorrectString()
        {
            //Arrange
            RepeatedMeasuresParametricAnalysisModel sut = GetModel(GetDataset());

            //Act
            string result = sut.GetCommandLineArguments();

            //Assert
            Assert.Equal("Resp2~Cov1+Block1+Block2+Treativs_sp_ivs1+Treativs_sp_ivs2+Timezzz+Treativs_sp_ivs1*Treativs_sp_ivs2+Treativs_sp_ivs1*Timezzz+Treativs_sp_ivs2*Timezzz+Treativs_sp_ivs1*Treativs_sp_ivs2*Timezzz Dayivs_sp_ivs1 Animal1 Cov1 \"Compound Symmetric\" None None Treativs_sp_ivs1 Treativs_sp_ivs1,Treativs_sp_ivs2 Block1,Block2 Y Y N 0.05 Resp2~Cov1+Block1+Block2+Treativs_sp_ivs2+mainEffect Treativs_sp_ivs1ivs_sp_ivs*ivs_sp_ivsDayivs_sp_ivs1 N AllComparisonsWithinSelected", result);
        }

        private RepeatedMeasuresParametricAnalysisModel GetModel(IDataset dataset)
        {
            var model = new RepeatedMeasuresParametricAnalysisModel(dataset)
            {
                ANOVASelected = true,
                ComparisonType = RepeatedMeasuresParametricAnalysisModel.ComparisonOption.AllComparisonsWithinSelected,
                Covariance = "Compound Symmetric",
                CovariateTransformation = "None",
                Covariates = new System.Collections.Generic.List<string>
                {
                    "Cov1"
                },
                LSMeansSelected = false,
                NormalPlotSelected = false,
                OtherDesignFactors = new System.Collections.Generic.List<string>
                {
                    "Block1",
                    "Block2"
                },
                PRPlotSelected = true,
                PrimaryFactor = "Treat 1",
                RepeatedFactor = "Day 1",
                Response = "Resp2",
                ResponseTransformation = "None",
                SelectedEffect = "Treat 1 * Day 1",
                Significance = "0.05",
                Subject = "Animal1",
                Treatments = new System.Collections.Generic.List<string>
                {
                    "Treat 1",
                    "Treat 2"
                }
            };

            return model;
        }


